// Fireworks.js
import React from 'react';
import './fireworks.css';

const Fireworks = () => {
    // Replace with your actual image URLs
    const images = [
        'image1.jpg',
        'image2.jpg',
        'image3.jpg',
        'image4.jpg',
        'image5.jpg',
        'image6.jpg',
        'image7.jpg',
        'image8.jpg',
    ];

    return (
        <div className="fireworks-grid">
            {images.map((image, index) => (
                <div key={index} className="fireworks-item">
                    <img src={image} alt={`Fireworks ${index + 1}`} />
                </div>
            ))}
        </div>
    );
};

export default Fireworks;
